import { useQuery } from "react-query";
import { getHelloWorld } from "../api/api";
import '../styles/App.css';

function App() {
  const uniqParam = 'foobar'
  const { isLoading, error, data, isFetching } = useQuery(
    [`helloWorld-${uniqParam}`,{uniqParam}], 
    getHelloWorld, 
    {keepPreviousData:true, enabled:true});

  console.log(data)

  return (
    <div className="App">
      <header className="App-header">
        <p>Hello World</p>
        {data && !error ? <p>{data}</p> :undefined}
      </header>
    </div>
  );
}

export default App;
